import React, { Component } from "react";

export default class extends Component {
  render() {
    let { url } = this.props.glassesItem;
    return (
      <div className="col-2 my-5">
        <button className="btn btn-light">
          <img style={{ width: "100%", height: "100%" }} src={url}></img>
        </button>
      </div>
    );
  }
}
